import { useEffect} from 'react';
// @mui material components
import Box from '@mui/material/Box';
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import * as React from 'react';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TextField from '@mui/material/TextField';
// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import MDButton from "components/MDButton";
import Stack from '@mui/material/Stack';
import {  Tabs, Tab,Divider} from '@mui/material';
import { useState} from 'react';
import { ToastContainer, toast } from 'react-toastify';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
function Quizzes() {
  const [numInputs, setNumInputs] = useState(1);
  const handleNumInputsChange = (event) => {
    const value = parseInt(event.target.value);
    setNumInputs(value);
  };
  const [open, setOpen] = React.useState(false);
  const handleClose = () => setOpen(false);
  const [tabIndex, setTabIndex] = useState(0);

  const handleChangeTab = (event, newValue) => {
    setTabIndex(newValue);
  };
  const generateInputFields = () => {
    const inputFields = [];
    for (let i = 0; i < numInputs; i++) {
      inputFields.push(
        <MDBox sx={{justifyContent:'center'} }>
          <Grid item key={i} xs={12}>
        <TextField
          key={i}
          label={`Question ${i + 1}`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2, ml: 2 }}
        />
         <TextField
          key={i}
          label={`Constraints ${i + 1}`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2, ml: 2}}
        />
        <TextField
          key={i}
          label={` Sample Input  ${i + 1}`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2, ml: 2 }}
        />
        <TextField
          key={i}
          label={` Sample Output  ${i + 1}`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2 , ml: 2 }}
        />
        <TextField
          key={i}
          label={` Hidden Test Case Input 1`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2 , ml: 2}}
        />
        <TextField
          key={i}
          label={` Hidden Test Case Output 1`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2 , ml: 2 }}
        />
         <TextField
          key={i}
          label={` Hidden Test Case Input 2`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2, ml: 2  }}
        />
        <TextField
          key={i}
          label={` Hidden Test Case Output 2`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2 , ml: 2}}
        />
        <TextField
          key={i}
          label={` Hidden Test Case Input 3`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2, ml: 2 }
        }
        />
        <TextField
          key={i}
          label={` Hidden Test Case Output 3`}
          variant="outlined"
          sx={{ width: '40%',mb:2 ,mr: 2, ml: 2 }}
        />

      </Grid>
      {i < numInputs - 1 && <Divider sx={{ marginY: 2, backgroundColor: 'red' }} />} {/* Add a divider except for the last group */}
        </MDBox>


      );
    }
    return inputFields;
  };

const[questionBankData,setquestionBankData]=useState([]);
const [formData, setFormData] = useState({
  bankName:"",
  bankType:"",
  bankDifficulty:"",
  questionFile:null
});
const [formattedData, setFormattedData] = useState(null);
useEffect(()=>{

  console.log(formattedData,open)
},[formattedData])
 const handleCreateButton= async()=>{
console.log(formData.questionFile);
  try{
    const response = await fetch(`http://localhost:5001/testCreate`, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify(formData),
    });
      const result = await response.json();
      //toast("question bank created")
      alert("success");
      fetchData();
  }
  catch (error){
    console.log(error);
  }
 }
 const handleViewQuestions= async(ID)=>{
  try {
    const response = await fetch(`http://localhost:5001/question/${ID}`);
    const jsondata=await response.json();
    setOpen(true)
    console.log(jsondata);
    setFormattedData(jsondata);


  } catch (error) {
    console.error('Error fetching questions:', error);
  }
 }
const columns=[
  { Header: "Bank Name", accessor:"Name", width: "45%", align: "left" },
  { Header: "Type", accessor: "Type", align: "left" },
  { Header: "Difficulty ", accessor: "Difficulty", align: "center" },
  { Header: "action", accessor: "Action", align: "center" },
]
 const rows = questionBankData.map(questionBank => ({
  Name: questionBank.BankID,
  Difficulty: questionBank.Difficulty, // Add logic to calculate difficulty if needed
  Type: questionBank.BankType, // Add logic to calculate creation date if needed
  Action: (
    <MDBox>
      <MDButton color="info" onClick={() => handleViewQuestions(questionBank.BankID)}>
        View
      </MDButton>
      <MDButton color="error">
        Delete
      </MDButton>
    </MDBox>
  ),
}));

 const fetchData = async () => {
  try {
    const response = await fetch("http://localhost:5001/questionBankData");
    const result = await response.json();
    setquestionBankData(result);
  } catch (error) {
    console.error("Error fetching  awareness program:", error);
  }
};
useEffect(() => {
  fetchData();
}, [formData]);
  return (
    <DashboardLayout>
      <MDBox pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <ToastContainer/>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
              >
                <MDTypography variant="h6" color="white">
                  Quiz list
                </MDTypography>
              </MDBox>
              <MDBox pt={3}>
                <DataTable
                  table={{ columns, rows }}
                  isSorted={false}
                  entriesPerPage={false}
                  showTotalEntries={false}
                  noEndBorder
                />
              </MDBox>
            </Card>
          </Grid>
          <Dialog maxWidth="lg" open={open}  justifyContent="center"onClose={handleClose}>
                <DialogTitle>Questions</DialogTitle>
                <DialogContent>
                  <DialogContentText>
                  <Box component="form" sx={{ width: '600px', height: 'auto', textAlign: 'center' }} noValidate autoComplete="off">
      {formattedData && formattedData.questions.map(question => (
        <Box key={question.QuestionID} mb={2}>
          <MDTypography variant="h5" mb={1}>
            {question.QuestionText}
          </MDTypography>
          <ul style={{ textAlign: 'left', listStyleType: 'none', paddingLeft: 0 }}>
            {question.Options.map(option => (
              <li key={option.OptionID}>
                <MDTypography component="span">
                  {option.OptionText}
                </MDTypography>
                <MDTypography component="span" color={option.IsCorrect ? 'success' : 'error'} ml={1}>
                  {option.IsCorrect ? '(Correct)' : '(Incorrect)'}
                </MDTypography>
              </li>
            ))}
          </ul>
        </Box>
      ))}
    </Box>

                  </DialogContentText>
                </DialogContent>
                <DialogActions>
                  <MDButton onClick={handleClose} color="primary">
                    Cancel
                  </MDButton>
                  <MDButton onClick={handleClose} color="primary" autoFocus>
                    Save
                  </MDButton>
                </DialogActions>
              </Dialog>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
              >
                <MDTypography variant="h6" color="white">
                  Coding Bank
                </MDTypography>
              </MDBox>
              <MDBox pt={3}>
                <DataTable
                  table={{ columns:columns, rows:rows }}
                  isSorted={false}
                  entriesPerPage={false}
                  showTotalEntries={false}
                  noEndBorder
                />
              </MDBox>
            </Card>
          </Grid>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
              >
                <MDTypography variant="h6" color="white">
                  Quiz Creation
                </MDTypography>
              </MDBox>
              <MDBox pt={3} justifyContent="center">
              <Box pt={3} justifyContent="center">
      <Box sx={{ width: '100%' }}>
        <Tabs value={tabIndex} onChange={handleChangeTab}>
          <Tab label="Quiz Creation" />
          <Tab label="Coding Question" />
        </Tabs>
        <Stack spacing={2} alignItems="center" sx={{marginTop:'20px'}}>
          {tabIndex === 0 && (
            <>

              <TextField
                id="quiz-name"
                label="Quiz name"
                onChange={(e) =>
                  setFormData({ ...formData, bankName: e.target.value })
                }
                variant="outlined"
                sx={{ width: '40%' }}
              />
             <FormControl variant="outlined" sx={{ width: '40%' }}>
                  <InputLabel>Select test type</InputLabel>
                  <Select
                    label="Test Name"

                    onChange={(e) =>
                      setFormData({ ...formData, bankType: e.target.value })
                    }
                    variant="outlined"
                    sx={{ height: '50px' }}
                  >
                    <MenuItem value="">None</MenuItem>
                    <MenuItem value="Technical MCQ">MCQ</MenuItem>
                    <MenuItem value="Logical MCQ">Coding</MenuItem>
                    <MenuItem value="Aptitude MCQ">Coding</MenuItem>
                    <MenuItem value="Verbal MCQ">Coding</MenuItem>
                  </Select>
                </FormControl>
              <TextField
                id="quiz-difficulty"
                label="Quiz Difficulty"
                variant="outlined"
                onChange={(e) =>
                  setFormData({ ...formData, bankDifficulty: e.target.value })
                }
                sx={{ width: '40%' }}
              />
              <TextField
                id="file-upload"
                variant="outlined"
                type="file"
                accept=".xlsx"
                onChange={(e) =>
                  setFormData({ ...formData, questionFile: e.target.value })
                }
                sx={{ width: '40%' }}
              />
              <MDButton color='info' onClick={handleCreateButton} > Create</MDButton>
            </>
          )}
         {tabIndex === 1 && (
            <>
              <TextField
                id="num-inputs"
                label="Number of Questions"
                variant="outlined"
                type="number"
                value={numInputs}
                onChange={handleNumInputsChange}
                sx={{ width: '40%' }}
              />
              {generateInputFields()}
              <MDButton  color="info" onClick={handleCreateButton}>
                Create
              </MDButton>
            </>
          )}
        </Stack>
      </Box>
    </Box>
              </MDBox>
            </Card>
          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Quizzes;
